#pragma once

#include <sstream>
#include "test_gen.hpp"

std::vector<vec_type> manual_test_instances() {
  std::vector<vec_type> result;
  auto add_string = [&](std::string str) {
    result.push_back(vec_type());
    vec_type &instance = result.back();
    instance.reserve(str.size() + 2);
    instance.push_back(test_gen_sentinel);
    instance.insert(instance.end(), str.begin(), str.end());
    instance.push_back(test_gen_sentinel);
  };
  add_string("AAA");
  add_string("AAAAAAAAAAAAAAAA");
  add_string("AAABBABBA");
  add_string("AAAABABABBABBA");
  add_string("AABAABAB");
  add_string("ABBABBABBB");
  add_string("BABBAAAABAAABABBAAABBBAAABABAB");
  add_string("CBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBCBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBB");
  add_string("");
  add_string("");
  add_string("");
  add_string("");
  add_string("");

  return result;
}